INSERT INTO `debate` VALUES (1,'6802390285b5ccd24db0581.23735850.jpeg','Titulo1','2018-07-28 17:08:04','I','Tema1','O Brasil, a Lua demorou para aparecer. Por volta das 18h, quando o céu ficou mais escuro por aqui, os primeiros registros foram feitos. Foi o eclipse mais longo do século, com melhor visibilidade na Europa e na África. Sol, Terra e Lua se alinharam, e milhares de pessoas conseguiram acompanhar pelo mundo. ',1),(2,'15685508315b5ccde0330624.72623462.jpeg','Titulo2','2018-07-28 17:11:12','I','Tema2','O Brasil, a Lua demorou para aparecer. Por volta das 18h, quando o céu ficou mais escuro por aqui, os primeiros registros foram feitos. Foi o eclipse mais longo do século, com melhor visibilidade na Europa e na África. Sol, Terra e Lua se alinharam, e milhares de pessoas conseguiram acompanhar pelo mundo. ',1),(6,'17260795155b5f7039697760.53574087.jpeg','Titulo3','2018-07-30 17:08:25','A','Tema3','Dasdasdasdmnlfdsg\r\ndfg\r\ndh\r\nfghfghfghfgh\r\nfgh\r\nfg\r\nhfg\r\nh\r\nfghfghfghfgh\r\n\r\nhfghfghfgh',2),(7,'15412471415b634b78d6f438.80662608.jpg','Novo Teste','2018-08-02 15:20:40','I','Teste','Dsadasjdaslkdjaklsdjklasjdlkasjldkjaskdlkasd\r\nfgsgjdsfjgldfjsgljldfjfdjglj\r\ngdçldfjgkjdfgjdfkgkdjfgkjdfkgjkdfgdfg\r\ndlgkjfdkjgdkjfkjfdkjgdkjkjdfskjsdgkjkjsdiqaw vroijnjfn lgfjuhewujrarueijhg',1),(8,'17874108135b634ce49f6250.82056001.png','Novo Teste2','2018-08-02 15:26:44','I','Teste2','Adsasdasiodhajkfdhkjs fdsjkah jkshgkj hfdskjg hdksfjg kjsdhfgj khkjfsdg kjsdg kjhdfskgj hdskjfgh kjdsf\r\n igfdjg jdslkg gkdsj klfdsjgjdsg g kdslfgjkfdsgj klgk lsjkgd \r\n',1),(9,'14510540505b634ce88b5ee5.03941712.png','Novo Teste2','2018-08-02 15:26:48','I','Teste2','Adsasdasiodhajkfdhkjs fdsjkah jkshgkj hfdskjg hdksfjg kjsdhfgj khkjfsdg kjsdg kjhdfskgj hdskjfgh kjdsf\r\n igfdjg jdslkg gkdsj klfdsjgjdsg g kdslfgjkfdsgj klgk lsjkgd \r\n',1),(14,'3782531955b634e6ac6d7b0.47994861.png','Novo Teste2','2018-08-02 15:33:14','I','Teste2','Dasfadksjfldsjfsda\r\nf\r\ndsafsdafjaslkdfjsdjgldsgjds\r\ng\r\nfdgjsdlkgfdjgdsfjgjdsfg',1),(15,'463582805b634e841b4ed6.74097297.png','Novo Teste2','2018-08-02 15:33:40','I','Teste2','Dasfadksjfldsjfsda\r\nf\r\ndsafsdafjaslkdfjsdjgldsgjds\r\ng\r\nfdgjsdlkgfdjgdsfjgjdsfg',1),(16,'12290335205b88c3fa856725.48025053.png','Teste','2018-08-31 01:28:42','I','Dasldkaçls','Dsadasdasdasdasdasdasd',1),(17,'7943888895bba1ef36d2190.51603260.png','Teste242424','2018-09-01 00:09:09','I','Pulitikas23sdsdsdasd','132123123123123123123123123123123  543534534534',1),(18,'21207247915ba2a5dd310e28.30727605.png','Fora Dilma','2018-09-19 16:39:09','A','Política','Em linguística, a noção de texto é ampla e ainda aberta a uma definição mais precisa. Grosso modo, pode ser entendido como manifestação linguística das ideias de um autor, que serão interpretadas pelo leitor de acordo com seus conhecimentos linguísticos e culturais. Seu tamanho é variável.\r\n\r\n“Conjunto de palavras e frases articuladas, escritas sobre qualquer suporte”[1].\r\n\r\n“Obra escrita considerada na sua redação original e autêntica (por oposição a sumário, tradução, notas, comentários, etc.)”[2].\r\n\r\n&#34;Um texto é uma ocorrência linguística, escrita ou falada de qualquer extensão, dotada de unidade sociocomunicativa, semântica e formal. É uma unidade de linguagem em uso.&#34;[3]\r\n\r\nO interesse pelo texto como objeto de estudo gerou vários trabalhos importantes de teóricos da Linguística Textual, que percorreram fases diversas cujas características principais eram transpor os limites da frase descontextualizada da gramática tradicional e ainda incluir os relevantes papéis do autor e do leitor na construção de textos.\r\n\r\nUm texto pode ser escrito ou oral e, em sentido lato, pode ser também não verbal.\r\n\r\nTexto crítico é uma produção textual que parte de um processo reflexivo e analítico gerando um conteúdo com crítica construtiva e bem fundamentada.\r\n\r\nEm artes gráficas, o texto é a parte verbal, linguística, por oposição às ilustrações.\r\n\r\nTodo texto tem que ter alguns aspectos formais, ou seja, tem que ter estrutura, elementos que estabelecem relação entre si. Dentro dos aspectos formais temos a coesão e a coerência, que dão sentido e forma ao texto. &#34;A coesão textual é a relação, a ligação, a conexão entre as palavras, expressões ou frases do texto”[4]. A coerência está relacionada com a compreensão, a interpretação do que se diz ou escreve. Um texto precisa ter sentido, isto é, precisa ter coerência. Embora a coesão não seja condição suficiente para que enunciados se constituam em textos, são os elementos coesivos que lhes dão maior legibilidade e evidenciam as relações entre seus diversos componentes, a coerência depende da coesão.',2),(19,'12370742195baa9060ce6cf6.69526812.png','Afdasdas','2018-09-25 16:45:36','I','Dasdasdasdas','Dsadasdasdasdasdas',2),(20,'16659360585baa90e8b78100.72764258.png','Dasdas','2018-09-25 16:47:52','I','Asdasdasd','Sfdfsdfsdfsdfsdfsdf',2),(21,'11561317515baa99d7d69973.63749380.png','Dasdasd','2018-09-25 17:25:59','I','Asdasdasd','Gdfgdfgdfgdfgdfgdf',2),(22,'7780533005bb0eb9bcbb587.93177532.jpg','Dasdasdas','2018-09-30 12:28:27','I','Ddsadasdas','Dasdasdasdasd',2),(23,'792750255bb7cb149aa847.35327212.jpg','Dasdasd2332232332232','2018-09-30 12:38:06','I','Asdasdasds','Dasdadsadasdsa                                                        ',2),(24,'4845122005bb8ffaca9e7b1.68337688.jpg','Teste do corte','2018-10-06 15:32:12','I','13','Fdsgfsd gdfg dfghdhgf  hfgh ',2),(25,'17057720755bbf9476356b8269469421.png','Dasd','2018-10-11 15:20:38','I','Asdasd','Asdasdasdasd',1),(26,'14369100695bbf99b290026394544108.png','Dsadasds','2018-10-11 15:42:58','I','Asdasdasdasdasd','Dasdasdasdasdasdasdasdasdasd',1),(27,'19738145785bbfa12242277973742070.png','Dasdasd','2018-10-11 16:14:42','I','Dasdasd','Dasdasdasdasdsadasdasdasdasd',1),(28,'5758504335bc0d617e3198398356415.png','Dasd','2018-10-12 14:12:55','I','Asdasdasdas','Dasdsadasdasdas',1),(29,'5076821735bf8b5af40a4e432783819.png','Dasdas