 principais eram transpor os limites da frase descontextualizada da gramática tradicional e ainda incluir os relevantes papéis do autor e do leitor na construção de textos.\r\n\r\nUm texto pode ser escrito ou oral e, em sentido lato, pode ser também não verbal.\r\n\r\nTexto crítico é uma produção textual que parte de um processo reflexivo e analítico gerando um conteúdo com crítica construtiva e bem fundamentada.                    ','Exemplo da novas','2018-09-19 16:32:59',2,4,'06462040','10544854245ba2a46b0ddec3.07215319.jpg'),(28,'A','Sdfsdfsdfsdfsdfsdf','Dsadasd','2018-10-06 15:59:56',2,3,'06515045','2594803665bb9062cb00d47.79026198.png'),(29,'A','Gfdgdfgfdgdfgdfgfdgdfgdfg                    ','Dsadasd2343','2018-10-06 16:16:25',2,5,'06515045','17337645565bb90a093ae860.86607272.png'),(30,'A','Teste da integracao                    ','Jaqionhas','2018-10-07 12:06:35',1,2,'06515045',''),(31,'A','Teste da integracao                    ','Jaqionhas','2018-10-07 12:06:40',1,2,'06515045',''),(32,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:29:34',1,3,'06515045','6620286215bbf968e54bbe154864762.png'),(33,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:29:35',1,3,'06515045','9143188835bbf968f5dcb0890576718.png'),(34,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:30:48',1,3,'06515045','2786718685bbf96d8a9fbf271899844.png'),(35,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:32:18',1,3,'06515045','1197797545bbf973205694816127287.png'),(36,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:32:42',1,3,'06515045','6985424945bbf974a7ac5a879315920.png'),(37,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:32:48',1,3,'06515045','13040444795bbf975000df8671861272.png'),(38,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:33:00',1,3,'06515045','9426963355bbf975ce41ce926290076.png'),(39,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:33:35',1,3,'06515045','10899110265bbf977f4ff41323683525.png'),(40,'A','Dasdasdasdasdasdasd','Dasdasd','2018-10-11 15:36:06',1,3